create table PCEDOENTES
(
  NUM_SEQUENCIAL    NUMBER(10) not null primary key,
  NUM_PROCESSO      NUMBER(8),
  DTA_NASCIMENTO    DATE,
  SEXO              CHAR,
  LOC_MORADA        VARCHAR2(200),
  COD_POSTAL        NUMBER(4),
  DTA_REGISTO       DATE,
  NUM_MECANOGRAFICO NUMBER(5),
  DES_POSTAL        VARCHAR2(200),
  ESTADO_CIVIL      VARCHAR2(10),
  COD_PROFISSAO     NUMBER(10)
);


